choices.text:
byte[] seed;
if (this.seed == null) {
	seed = new byte[1];
}
else {
	InputStream inputStream = this.seed.getInputStream();
	seed = FileCopyUtils.copyToByteArray(inputStream);
}
rnd.setSeed(seed);

InputStream inputStream = seed.getInputStream();
if (inputStream == null) {
	rnd.nextBytes(new byte[1]);
}
else {
	rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}

if (seed == null) {
	rnd.nextBytes(new byte[1]);
} else {
	byte[] seedBytes = seed.getBytes();
	rnd.setSeed(seedBytes);
}

